import web from "../src/images/web.jpeg";
import web1 from "../src/images/web1.jpeg";
import web3 from "../src/images/web3.jpeg";
import web4 from "../src/images/web4.jpeg";
import sotfware from "../src/images/sotfware";
import soft from "../src/images/soft.jpeg";
import marketing from "../src/images/marketing.jpeg";
import developer from "../src/images/developer.jpeg";
const Sdata = [
    {
        imgsrc:web,
        title:"web development",
    },
    {
        imgsrc:web1,
        title:"web development",
    },

    {
        imgsrc:web3,
        title:"web development",
    },
   
    {
        imgsrc:web4,
        title:"web development",
    },

    {
        imgsrc:sotfware,
        title:"software developer",
    },
    {
        imgsrc:soft,
        title:"software development",
    },
    {
        imgsrc:marketing,
        title:"product marketinng",
    },

    {
        imgsrc:developer,
        title:"web development",
    }
]

export default Sdata;
